SET SERVEROUTPUT ON;
  declare
    l_result varchar2(100);
    l_comm   varchar2(10);
    l_input  varchar2(4000);
    l_count  binary_integer;
    l_array  dbms_utility.lname_array;
    CURSOR c_get_payments_to_calc IS
      SELECT DISTINCT
             country_code,
             contribution_date,
             payment_type
          FROM comms_payments_received
         ORDER BY 1, 3, 2;

  BEGIN
    lhhcom.refresh_pay_comms;
    FOR x IN c_get_payments_to_calc LOOP
      l_result := NULL;
      IF TRIM(x.payment_type) IS NULL THEN
        l_result := '-<NULL>';
        l_comm   := 'Yes';
      ELSE
        dbms_utility.comma_to_table (list   => regexp_replace(replace(regexp_replace(x.payment_type, '-', ','), ' ', NULL), '(^|,)', '\1x')
                                    ,tablen => l_count
                                    ,tab    => l_array);
        FOR i IN 1 .. l_count LOOP
          l_result := l_result || '-' || lhhcom.iscommissionable_prem_code(substr(l_array(i),2), x.contribution_date, x.country_code);
        END LOOP;
        IF l_result like '%No%' THEN
          l_comm   := 'No';
        ELSIF l_result like '%Missing%' THEN
          l_comm   := 'Missing';
        ELSIF l_result like '%Yes%' THEN
          l_comm   := 'Yes';
        ELSE
          l_comm   := 'Error';
        END IF;
      END IF;
      dbms_output.put_line(substr(l_comm || '        ', 1, 8) ||
                           'Commissionable Ind Deducted for ' || 
                           'Country ' || substr(x.country_code || '  ', 1, 2) ||
                           ', Date ' || substr(x.contribution_date || '          ', 1, 10) ||
                           'and PmtType ' || substr('"' || x.payment_type || '"               ', 1, 12) ||
                           '- ' || trim(substr(l_result, 2, 100)));
    END LOOP;
  END;
  /
  
